import Vue from 'vue';
import Vuetify from 'vuetify/lib/framework';

Vue.use(Vuetify);
export default new Vuetify({
    theme: {
        themes: {
            light: {
                primary: '#ff0000', // Color primario
                secondary: '#00ff00', // Color secundario
                accent: '#0000ff', // Color de acento
            },
        },
    },
});
